            <StyledMobileLogo className='logoMobile' src={logoMobile} />
          </Link>
        </>
      ) : (
        <>
          <Link href='/dashboard'>
            <StyledLogo className='logo' src={logo} />
          </Link>
          <Link href='/dashboard'>
            <StyledMobileLogo className='logoMobile' src={logoMobile} />
          </Link>
        </>
      )} */}
    </Fragment>
  );
};
